    - ID: "5a236869-e375-49c0-a92d-0c2f1db7788f"
      Hint: Content
      Value: <p>Once in awhile you will find a finicky snake that will only eat live prey, however, almost all snakes will willingly eat frozen rodents. Frozen is easier because you can buy more at once and keep them in your freezer and they are much safer since the rodent can&rsquo;t bite the snake. It&rsquo;s important to make sure when thawing out your frozen rodent before feeding, that you allow it to sit in hot water (from the sink, not the stove) and you must make sure that it is fully thawed before presenting it to the snake for feeding. When choosing a size, you want to feed your snake a rodent that is as large around as he is at the largest part of his body.</p>
